Ever wonder why a simple glance can shift everything between two people? Dr Allan Schore from @ucla breaks down the neuroscience behind what's actually happening in your brain during eye contact‚Äîand it's way more complex than most realize. According to his conversation with @hubermanlab, that initial gaze triggers an entire sequence of right brain synchronization that lets us genuinely access another person's emotional state. The episode dives into how these neural pathways form between infants and caregivers, shape our adult relationships, and determine whether we seek external support or process internally when stressed. They also tackle a fascinating question: is our texting habit rewiring us to be more left-brain dominant and losing our ability to emotionally attune face-to-face? Head to hubermanlab.com to catch the full discussion with timestamps for easy navigation.

